literals:
"body{
  background-color: #F5F5F5;
}
.demo {
    position: relative;

  }
  .demo .notificationsFrame {
    z-index: 2;
    width: 70%;
    top: 20px;
    background: #fff;
    border-radius: 3px;
    overflow: hidden;
    font-family: 'Open Sans', Helvetica, sans-serif;
    margin: 0 auto;
    border: 1px solid;
    border-color: #e5e6e9 #dfe0e4 #d0d1d5;
  }
  .demo .notificationsFrame.show-menu {
    transform: translate3d(150px, 0, 0);
  }
  .demo .notificationsFrame .searchInput {
    border: 10px solid red;
    box-sizing: border-box;
    position: absolute;
    top: 13px;
    right: 55px;
    width: 200px;
    height: 34px;
    border-radius: 17px;
    border: none;
    background: #fff;
    padding: 0 17px;
    font-size: 13px;
    color: #666;
    transition: all 0.3s ease-in-out;
    transform: translateX(15px);
    opacity: 0;
    pointer-events: none;
  }
  .demo .notificationsFrame .searchInput:focus {
    outline: none;
  }
  .demo .notificationsFrame .searchInput:active {
    -webkit-transform: translateX(0);
    transform: translateX(0);
    opacity: 1;
    pointer-events: all;
  }
  .demo .notificationsFrame .header {
    position: relative;
    height: 60px;
    background: #3b5998;
    padding-top: 0;
  }

  .demo .notificationsFrame .header .menuIcon {
    position: absolute;
    width: 29px;
    height: 15px;
    top: 23px;
    left: 20px;
    cursor: pointer;
  }
  .demo .notificationsFrame .header .menuIcon:hover .dashTop, .demo .notificationsFrame .header .menuIcon:hover .dashBottom, .demo .notificationsFrame .header .menuIcon:hover .circle {
    background: #fff;
  }
  .demo .notificationsFrame .header .menuIcon .dashTop {
    position: absolute;
    width: 20px;
    height: 3px;
    top: 0;
    left: 0;
    background: #b2daff;
    border-radius: 3px;
    -webkit-transition: all 0.2s ease-in-out;
    transition: all 0.2s ease-in-out;
  }
  .demo .notificationsFrame .header .menuIcon .dashBottom {
    position: absolute;
    width: 20px;
    height: 3px;
    top: 0;
    left: 0;
    background: #b2daff;
    border-radius: 3px;
    -webkit-transition: all 0.2s ease-in-out;
    transition: all 0.2s ease-in-out;
    width: 29px;
    top: auto;
    bottom: 0;
  }
  .demo .notificationsFrame .header .menuIcon .circle {
    position: absolute;
    height: 7px;
    width: 7px;
    border-radius: 4px;
    top: -2px;
    right: 0;
    background: #b2daff;
    -webkit-transition: all 0.2s ease-in-out;
    transition: all 0.2s ease-in-out;
  }
  .demo .notificationsFrame .header .title {
    display: block;
    text-align: center;
    color: #fff;
    font-weight: 600;
    font-size: 15px;

  }
  .demo .notificationsFrame .header .searchIcon {
    position: absolute;
    z-index: 3;
    font-size: 21px;
    color: #fff;
    top: 18px;
    right: 20px;
    -webkit-transition: all 0.3s ease;
    transition: all 0.3s ease;
    cursor: pointer;
  }
  .demo .notificationsFrame .header .searchIcon:hover {
    color: #fff;
  }
  .demo .notificationsFrame .content {
    position: relative;
    height: 100%;
    overflow: hidden;
  }
  .demo .notificationsFrame .content .line {
    position: absolute;
    top: 0;
    left: 40px;
    bottom: 0;
    width: 3px;
    background: #ebebeb;
  }
  .demo .notificationsFrame .content .item {
    position: relative;
    z-index: 2;
    margin: 20px 30px 30px 70px;
    display: block;
    /*border-radius: 50%;
     border: 5px solid #ecf0f1;
     box-sizing: border-box;
     position: absolute;
     height: 20px;
     width: 20px;
     background: #fff;
     border: 2px solid #5F98CD;
     box-shadow: 0 0 0 3px #fff;*/
  }
  .demo .notificationsFrame .content .item:hover {
    color: #5f98cd;
    cursor: pointer;
  }
  .demo .notificationsFrame .content .item .circle {
    box-sizing: border-box;
    position: absolute;
    height: 11px;
    width: 11px;
    background: #fff;
    border: 2px solid #5f98cd;
    box-shadow: 0 0 0 3px #fff;
    border-radius: 6px;
    top: 0;
    left: -20px;
  }
  .demo .notificationsFrame .content .item .avatar {
    position: absolute;
    height: 40px;
    width: 40px;
    display: inline-block;
    vertical-align: top;
    overflow: hidden;
    left: -49px;
  }
  .demo .notificationsFrame .content .item .avatar img {
    width: 100%;
    -webkit-border-radius: 50%;
    -moz-border-radius: 50%;
    -ms-border-radius: 50%;
    -o-border-radius: 50%;
    border-radius: 50%;
    position: absolute;
    left: 0;
    top: 0;
  }
  .demo .notificationsFrame .content .item .time {
    display: block;
    font-size: 11px;
    line-height: 11px;
    margin-bottom: 2px;
  }
  .demo .notificationsFrame .content .item p {
    font-size: 15px;
    line-height: 20px;
    margin: 0px 40px 0px 0px;
    font-family: 'Open Sans', Lora, Times, no-serif;
  }
  .demo .notificationsFrame .content .item p b {
    font-weight: 600;
  }
  .demo .notificationsFrame .content .item .right {
    position: absolute;
    right: 5px;
    font-size: 11px;
    top: 11px;
  }
  .demo .notificationsFrame .content .item .commentCount {
    position: absolute;
    right: 15px;
    font-size: 12px;
    top: 11px;
  }
  .demo .notificationsFrame .content .item .commentCount:after {
    content: "\F075";
    font-family: FontAwesome;
    position: absolute;
    font-size: 20px;
    color: #ebebeb;
    top: -50%;
    left: 100%;
    margin-left: 10px;
    z-index: 3;
  }
  .demo .notificationsFrame .content .item .commentCount:hover:after {
    color: lightblue;
  }

  .demo .notificationsFrame .footer {
    position: relative;
    background: #fff;
    margin: auto;
    height: 30px;
    border-top: 1px solid #eee;
    width: 100%;
    border-radius: 10px;
  }
  .demo .notificationsFrame .footer button {
    background: #eee;
    position: absolute;
    width: 100%;
    right: 0px;
    left: 0px;
    top: 0px;
    bottom: 0px;
    border: 0;
  }
  .demo .notificationsFrame .footer button i {
    margin: 0 10px;
  }
  .clock {
    width: 600px;
    height: 50px;
    padding: 20px;
    font-family:-apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;    
    font-weight: bold;
    color: white;
    font-size: 3em;
    background-color:#e21e90;
    border-radius: 10px;
    text-align: center;

  }
  .header, .fa, .title, .searchIcon {
    color: #333333;
  }"

